		console.log(ready[0]?.price);

		return(
			<div>
			{ready[0]?.price}
			<p>{ready[0]?.name}</p>
			</div>
		)
	});

	const navigate = useNavigate();

	const navigateHandler = () => {
		navigate("/");
	};

	return (
		<div>
			<h1>Detailed Screen</h1>
			{allProducts} 
			<button onClick={navigateHandler}>Navigate</button>
		</div>
	);
};

export default DetailedScreen;
